global !p

def write_docstring_args(arglist, snip):
	args = str(arglist).split(',')

	if len(args) &gt; 1:
		c = 0
		for arg in args:
			if c == 0:
				snip.rv += arg
				c = 1
			else:
				snip += '*       : %s' % arg.strip()
	else:
		snip.rv = args[0]


endglobal

